import sys

def unscramble(cipher):
    try:
        # Convert string representation to Python object
        data = eval(cipher)
        
        # Extract only the first hex value from each sublist in the correct order
        flag = ""
        for item in data:
            if isinstance(item, list) and len(item) > 0:
                # Get the first hex value which contains the original character
                hex_val = item[0]
                # Convert hex to character
                char = chr(int(hex_val, 16))
                flag += char
        
        return flag
    except Exception as e:
        print(f"Error unscrambling: {e}")
        return None

def test_scramble(text):
    """Test function to validate our understanding of the scrambling algorithm"""
    # Create initial list with hex values
    hex_flag = []
    for c in text:
        hex_flag.append([str(hex(ord(c)))])
    
    print("Original:", hex_flag)
    
    # Apply the scrambling algorithm
    A = hex_flag
    i = 2
    while (i < len(A)):
        A[i-2] += A.pop(i-1)
        A[i-1].append(A[:i-2])
        i += 1
    
    print("Scrambled:", A)
    return A

